
package org.drc.amqclient;

import javax.jms.JMSException;
import javax.jms.Message;
import javax.jms.Session;
import javax.jms.TextMessage;

import org.apache.logging.log4j.LogManager;
import org.apache.logging.log4j.Logger;
import org.springframework.jms.annotation.JmsListener;
import org.springframework.jms.listener.SessionAwareMessageListener;
import org.springframework.stereotype.Component;

@Component
public class MyHandler implements SessionAwareMessageListener<Message>
{
    private static final Logger LOG = LogManager.getLogger();

    private final DataColllector coll;

    public MyHandler(final DataColllector _coll)
    {
        coll = _coll;
        LOG.info("Staring Handler");
    }

    @JmsListener(destination = "drcmon.topic", subscription = "drcmon.sub", containerFactory = "myFactory")
    @Override
    public void onMessage(Message _message, Session session) throws JMSException
    {
        final TextMessage msg = (TextMessage) _message;
        coll.addElement(msg.getText());

    }

}
